import React, { Component } from "react";
import { connect } from "react-redux";
import { bindActionCreators } from 'redux';
import { Route, Link, Switch } from "react-router-dom";

class Home extends Component {
    render() {
        return(
            <div>
                 <nav className="navbar-fixed">
                    <div className="d-flex flex-col navBar">
                        <div><strong className="text-white mr-2">Movies</strong></div>
                        <div><strong className="text-white">TV Shows</strong></div>
                        <div className="p-1 bg-warning offset-md-1"><strong className='text-white logoText'>TMDb</strong></div>  
                        <input className="ml-3 p-2 searchInp" type="search" placeholder="Search"></input>
                        <button className="px-4 searchBtn"><i className="fa fa-search"></i></button>
                    </div>
                </nav>
            </div>
        )
    }
}

export default Home;
